import react from "react";

function Navbar() {
  return (
    <nav className="navbar">
      <ul className="navbar-menu">
        <li className="navbar-item">
          <a href="/">Home</a>
        </li>
        <li className="navbar-item">
          <a href="/about">About</a>
        </li>
        <li className="navbar-item">
          <a href="/contact">Contact</a>
        </li>
        <li className="navbar-item">
          <a href="/blog">Blog</a>
        </li>
      </ul>
    </nav>
  );
}
export default Navbar;
